// client/src/components/Community.js
import React from 'react';

const Community = () => {
  return (
    <div className="page-container">
      <div className="hero">
        <h1>Community</h1>
        <p>Join our growing community of AI enthusiasts and experts</p>
      </div>
    </div>
  );
};

export default Community;
